                    {
                        con.Open();
                    }

                    using (SqlCommand cmd = new SqlCommand("SP_GET_RECORD_FROM_GIST_RENEWAL_NOTICE_DOWNLOAD", con))
                    {
                        cmd.CommandType = CommandType.StoredProcedure;
