        private string Fn_Get_Poductcode_From_GIST(string certificateNo, out string vErrorMsg)
        {
            string vProductCode = string.Empty;
            vErrorMsg = string.Empty;
            try
            {
                DataTable objDataTable = null;

                using (SqlConnection con = new SqlConnection(ConfigurationManager.ConnectionStrings["cnPASS"].ConnectionString))
                {
                    SqlCommand cmd = new SqlCommand("PROC_GET_PRODUCT_CODE", con);
                    cmd.CommandType = CommandType.StoredProcedure;
                    cmd.Parameters.AddWithValue("@vPolicyNumber", certificateNo);
                    SqlDataAdapter sda = new SqlDataAdapter(cmd);
                    objDataTable = new DataTable();
                    sda.Fill(objDataTable);
                }
                if (objDataTable != null)
                {
                    if (objDataTable.Rows.Count > 0)
                    {
                        vProductCode = objDataTable.Rows[0]["PRODUCTCODE"].ToString();
                    }
                }
                if (vProductCode.Length <= 0)
                {
                    vErrorMsg = "Error Occured, No Proposal Number Found for this Policy";
                }
            }
            catch (Exception ex)
            {
                vErrorMsg = ex.Message;
                //File.AppendAllText(logFile, " Error occured Fn_Get_Proposal_Number_From_GIST for Policy Number " + certificateNo
                   // + " Error description " + ex.ToString() + "   Error stack " + ex.StackTrace + "   "
                  //  + DateTime.Now.ToString() + System.Environment.NewLine);
            }
            return vProductCode;
        }

