        private void DownloadDocumentFromKites(string DocId, string CertificateNumber)
        {
            try
            {
                ServicePointManager.Expect100Continue = true;
                ServicePointManager.SecurityProtocol = SecurityProtocolType.Ssl3 | SecurityProtocolType.Tls | SecurityProtocolType.Tls11 | SecurityProtocolType.Tls12; //Added ServicePointManager

                string url = ConfigurationManager.AppSettings["KitesDownloadServiceURL"].ToString();
                clsKiteRequest objKiteReq = new clsKiteRequest
                {
                    docId = DocId
                };

                  string jsonContent = JsonConvert.SerializeObject(objKiteReq);

                //MemoryStream ms = new MemoryStream();
                //DataContractJsonSerializer serialize = new DataContractJsonSerializer(typeof(clsKiteRequest));
                //serialize.WriteObject(ms, objKiteReq);
                //string JsonString = Encoding.Default.GetString(ms.ToArray());

                HttpWebRequest request = (HttpWebRequest)WebRequest.Create(url);
                request.Method = "POST";


                request.ContentType = "application/json; charset=utf-8";
                request.Timeout = Timeout.Infinite;
                request.KeepAlive = true;
                request.Proxy = null;


                string IsUseNetworkProxyForKites = ConfigurationManager.AppSettings["IsUseNetworkProxyForKites"].ToString();
                if (IsUseNetworkProxyForKites == "1")
                {
                    WebProxy proxy = new WebProxy(ConfigurationManager.AppSettings["proxy_Url"].ToString());

                    string network_Username = ConfigurationManager.AppSettings["network_Username"].ToString();
                    string network_Password = ConfigurationManager.AppSettings["network_Password"].ToString();
                    string network_domain = ConfigurationManager.AppSettings["network_domain"].ToString();

                                  
                    proxy.Credentials = new NetworkCredential(network_Username, network_Password, network_domain);
                    proxy.UseDefaultCredentials = true;
                    WebRequest.DefaultWebProxy = proxy;
                    request.Proxy = proxy;


                    request.Proxy = WebRequest.DefaultWebProxy;
                    request.Credentials = new NetworkCredential(network_Username, network_Password, network_domain);
                    request.Proxy.Credentials = new NetworkCredential(network_Username, network_Password, network_domain);
                }

                using (StreamWriter writer = new StreamWriter(request.GetRequestStream()))
                {
                    writer.Write(jsonContent);
                }

                try
                {
                    System.Web.Script.Serialization.JavaScriptSerializer JSSerializer = new System.Web.Script.Serialization.JavaScriptSerializer();
                    JSSerializer.MaxJsonLength = Int32.MaxValue;
                    var response = (HttpWebResponse)request.GetResponse();
                    string responseString = new StreamReader(response.GetResponseStream()).ReadToEnd();
                    WebRequest.DefaultWebProxy = null;

                    clsKiteResponse objKiteResponse = JSSerializer.Deserialize<clsKiteResponse>(responseString);
                    var details = JObject.Parse(responseString);
                    string policyNumber = objKiteResponse.docName;
                    string base64String = Base64Decode(Convert.ToBase64String(objKiteResponse.data, 0, objKiteResponse.data.Length));

                    #region to save pdf
                    //string filelocation = ConfigurationManager.AppSettings["KotakPolicySchedules"].ToString();
                    //string filename = filelocation + "\\REN_" + policyNumber;
                    //if (File.Exists(filename))
                    //{
                    //    File.Delete(filename);
                    //}
                    //  File.WriteAllBytes(filename, Convert.FromBase64String(base64String));
                    //File.WriteAllBytes(filename, objKiteResponse.data);
                    #endregion
                    Response.AddHeader("Content-Type", "application/pdf");
                    Response.AddHeader("content-disposition", "attachment;filename="+ policyNumber );
                    // Response.AddHeader("Content-Disposition", String.Format("attachment; filename=GPAPolicySchedule_{1}.pdf; size={0}", objKiteResponse.data.Length.ToString(), policyNumber));
                    Response.Buffer = true;                 
                    Response.BinaryWrite(Convert.FromBase64String(base64String));
                    CommonExtensions.fn_AddLogForDownload(CertificateNumber, "FrmDownloadRenewalNotice.aspx"); //Added By Rajesh Soni 24/02/2020
                    Response.End();
                    


                }
                catch (WebException ex)
                {
                    String errorText;
                    WebResponse errorResponse = ex.Response;
                    using (Stream responseStream = errorResponse.GetResponseStream())
                    {
                        StreamReader reader = new StreamReader(responseStream, System.Text.Encoding.GetEncoding("utf-8"));
                        errorText = reader.ReadToEnd();
                    }
                    Alert.Show("Can not download Renewal Notice");
                    throw new Exception(errorText);
                }
                
            }
            catch (Exception ex)
            {

                File.WriteAllText(logFile, "Error Occured  " + CertificateNumber
                        + "  ErrorMessage " + ex.ToString() + "  " + DateTime.Now.ToString() + System.Environment.NewLine);
                Response.Write(ex.Message);
            }

        }
        private string Base64Decode(string base64EncodedData)
        {
            var base64EncodedBytes = System.Convert.FromBase64String(base64EncodedData);
            return System.Text.Encoding.UTF8.GetString(base64EncodedBytes);
        }
