        private string Fn_Generate_GIST_Auth_Key(string strUserId, string strPassword)
        {
            GCGenericService.GenericServiceClient proxy = new GCGenericService.GenericServiceClient();

            string AuthKey = proxy.Authenticate(strUserId, strPassword);
            proxy.Close();

            return AuthKey;
        }

        private string Fn_Get_Proposal_Number_From_GIST(string certificateNo, ref string vErrorMsg)
        {
            string vProposalNumber = string.Empty;

            try
            {
                DataTable objDataTable = null;

                using (SqlConnection con = new SqlConnection(ConfigurationManager.ConnectionStrings["cnPASS"].ConnectionString))
                {
                    SqlCommand cmd = new SqlCommand("PROC_GET_PROPOSAL_NUMBER", con);
                    cmd.CommandType = CommandType.StoredProcedure;
                    cmd.Parameters.AddWithValue("@PolicyNumber", certificateNo);
                    SqlDataAdapter sda = new SqlDataAdapter(cmd);
                    objDataTable = new DataTable();
                    sda.Fill(objDataTable);
                }
                if (objDataTable != null)
                {
                    if (objDataTable.Rows.Count > 0)
                    {
                        vProposalNumber = objDataTable.Rows[0]["NUM_REFERENCE_NUMBER"].ToString();
                    }
                }
                if (vProposalNumber.Length <= 0)
                {
                    vErrorMsg = "Error Occured, No Proposal Number Found for this Policy";
                }
            }
            catch (Exception ex)
            {
                vErrorMsg = ex.Message;
                File.AppendAllText(logFile, " Error occured Fn_Get_Proposal_Number_From_GIST for Policy Number " + certificateNo
                    + " Error description " + ex.ToString() + "   Error stack " + ex.StackTrace + "   "
                    + DateTime.Now.ToString() + System.Environment.NewLine);
            }
            return vProposalNumber;
        }



